package Questions;

import java.util.HashMap;

public class ValidAnagram {
    public static boolean isAnagram(String s, String t) {
        HashMap<String , Integer> map1 = new HashMap<>();
        HashMap<String , Integer> map2 = new HashMap<>() ;
        String[] array1 = s.split("") ;
        String[] array2 = t.split("") ;
        for(String str: array1){
            if(map1.containsKey(str)){map1.put(str , map1.get(str) + 1) ; }
            else{map1.put(str , 1) ; }
        }

        for(String str: array2){
            if(map2.containsKey(str)){map2.put(str , map2.get(str) + 1) ; }
            else{map2.put(str , 1) ; }
        }

        if(map1.size()!=map2.size()){
            return false ;
        }
        for(String key: map1.keySet()){
            if(!map2.containsKey(key)){return false ; }
            else{
                if(!map1.get(key).equals(map2.get(key))){return false; }
            }
        }

        return true ;
    }

    public static void main(String args[]){
        String one = "" ;
        String two = "" ;
        System.out.println(isAnagram(one , two));
    }
}
